from itertools import permutations
def A185173(n):
    c = n*(n+1)//2
    for i in range(2,n+1):
        for j in range(i+1,n+1):
            pset = set(range(2,n+1)) - {i,j}
            for p in permutations(pset):
                q, rset, rl = [j,1,i]+list(p), set(), 0
                for k in range(n):
                    r = 0
                    for l in range(n):
                        r += q[(k+l) % n]
                        if r not in rset:
                            rset.add(r)
                            rl += 1
                        if rl >= c:
                            break
                    else:
                        continue
                    break
                else:
                    c = rl
    return c # _Chai Wah Wu_, Oct 01 2021

